Laut Tiongkok Selatan adalah laut bagian tepi dari Samudra Pasifik, yang membentang dari Selat Karimata dan Selat Malaka, hingga Selat Taiwan dengan luas kurang lebih 3.500.000 km². Laut ini berpotensi besar strategis karena sepertiga perlintasan laut berlalu lalang di sana. Laut ini juga memiliki kekayaan biota laut yang mampu menopang kebutuhan pangan jutaan orang di Asia Tenggara sekaligus cadangan minyak dan gas alam yang besar. Menurut Limits of Oceans and Seas, 3rd Edition (1953) yang dirilis oleh Organisasi Hidrografi Internasional, laut ini terletak: 
* di sebelah selatan Tiongkok; 
* di sebelah timur Vietnam; 
* di sebelah barat Filipina; 
* di sebelah timur Semenanjung Malaya dan Sumatra hingga Selat Singapura di sebelah barat, dan 
* di sebelah utara Kepulauan Bangka Belitung dan Kalimantan Akan tetapi, menurut draf tak resmi edisi ke-4 (1986), Organisasi Hidrografi Internasional mengusulkan pembentukan Laut Natuna sehingga batas selatan Laut Tiongkok Selatan dipindahkan ke utara dari sebelah utara Kepulauan Bangka Belitung, ke sebelah utara dan timur laut Kepulauan Natuna. Kepulauan Laut Tiongkok Selatan terdiri atas sekian ratus pulau kecil. Laut beserta sebagian besar pulau tak berpenghuni diperebuti oleh berbagai negara. Klaim-klaim kedaulatan ini terbukti dari beragamnya nama yang diberikan untuk pulau-pulau dan laut ini.
